import React from 'react';

class Profile extends React.Component {
  render () {
    const { name, image, email, age } = this.props;

    return (
      <div>
        <h2>This is:</h2>
        <h3>{ name }</h3>
        <img src={ image } alt={ name } />
        <p>{ email }</p>
        <p>{ age }</p>
      </div>
    );
  }
}

export default Profile;
